function Chat() {


    return (
      <section className='chat'>
          <div className="chat_top"></div>
          <div className="chat_bottom">
          <input type="text" value='Type a message' name="send message" className='chat_msg'/>
          </div>
      </section>
    )
  }
  
  export default Chat
